  useEffect(()=>{
    console.log(props.course_id)
    axios.get(`http://localhost:8000/course/${props.course_id}`)
      .then(response=>{
        console.log('fetching... from grades')

        getStudents(response.data)
      })

  },[])
  return (
    <span>
      {' '+ studentList.course_name}
    </span>
  )
}

